  	overflow: hidden;
}
.container-tx {
	max-width: 800px;
  	overflow: hidden;
}

.inline {
display:flex;
align-items:center;
}

.tx-font14 {
  font-size:14px;
  }

.heading1 {
  font-size:16px;
  font-weight:bold;
  padding-left:48px;
  margin-bottom:-15px;
}

.flex-container-col {
  width:auto;
  height:auto;
  display:flex;
  flex-wrap:wrap;

}

.wrapword {
  word-wrap: break-word;
}

.form-text {
font-style:italic;
color:#ffa500;
font-size:14px;
font-weight:normal;
}

.form-text-bold {
font-style:normal;
color:#ffa500;
font-size:14px;
font-weight:bold;
}

.read {
pointer-events:none;
}

.comm, .percentage, .co_broke, .ownership {
pointer-events:none;
}

/* The sidebar menu */
div.sidenav {
  height: 100%; /* Full-height: remove this if you want "auto" height */
  width: 180px; /* Set the width of the sidebar */
  position: fixed !important; /* Fixed Sidebar (stay in place on scroll) */
  top: 0; /* Stay at the top */
  left: 0;
  background-color: #ffffff !important; /* light violet */
  overflow-x: hidden; /* Disable horizontal scroll */
  padding-top: 40px;
  padding-bottom: 60px;
  padding-left:8px;
	margin-top:62px !important;
}

/* The navigation menu links */
.sidenav a {
  padding: 6px 8px 6px 16px;
  text-decoration: none;
  font-size: 15px;
  color: #808080 !important;
  display: block;
  display: flex;
  align-items:center;
  padding-left:2px;

}

/* When you mouse over the navigation links, change their color */
.sidenav a:hover {
  color: #000000 !important;
	font-weight:600;
}

.form-name {
  padding:3px 15px;
  border-collapse:collapse;
  border:1px solid grey;
  border-radius:5px;
  text-align:center;
  margin-left:auto;
  margin-right:auto;
  margin-top:10px;
  width:550px;
}

#return-to-top {
    position: fixed;
    bottom: 110px;
    right: 20px;
    background: rgb(0, 0, 0);
    background: rgba(0, 0, 0, 0.7);
    width: 50px;
    height: 50px;
    display: block;
    text-decoration: none;
    -webkit-border-radius: 35px;
    -moz-border-radius: 35px;
    border-radius: 35px;
    display: none;
    -webkit-transition: all 0.3s linear;
    -moz-transition: all 0.3s ease;
    -ms-transition: all 0.3s ease;
    -o-transition: all 0.3s ease;
    transition: all 0.3s ease;
}
#return-to-top i {
    color: #fff;
    margin: 0;
    position: relative;
    left: 16px;
    top: 13px;
    font-size: 19px;
    -webkit-transition: all 0.3s ease;
    -moz-transition: all 0.3s ease;
    -ms-transition: all 0.3s ease;
    -o-transition: all 0.3s ease;
    transition: all 0.3s ease;
}
#return-to-top:hover {
    background: #b7b7b7;
}
#return-to-top:hover i {
    color: #fff;
    top: 5px;
}

#return-to-top-form {
    position: fixed;
    bottom: 55px;
    right: 20px;
    background: rgb(0, 0, 0);
    background: rgba(0, 0, 0, 0.7);
    width: 50px;
    height: 50px;
    display: block;
    text-decoration: none;
    -webkit-border-radius: 35px;
    -moz-border-radius: 35px;
    border-radius: 35px;
    display: none;
    -webkit-transition: all 0.3s linear;
    -moz-transition: all 0.3s ease;
    -ms-transition: all 0.3s ease;
    -o-transition: all 0.3s ease;
    transition: all 0.3s ease;
}
#return-to-top-form i {
    color: #fff;
    margin: 0;
    position: relative;
    left: 1px;
    top: 13px;
    font-size: 19px;
    -webkit-transition: all 0.3s ease;
    -moz-transition: all 0.3s ease;
    -ms-transition: all 0.3s ease;
    -o-transition: all 0.3s ease;
    transition: all 0.3s ease;
}
#return-to-top-form:hover {
    background: #b7b7b7;
}
#return-to-top-form:hover i {
    color: #fff;
    top: 5px;
}
.box1 {
    display: inline-block;
    width: 20px;
    height: 50px;
}

.bs-navform.bs-navform.bs-navform {

height: 110px;

}


/* Style page content */
.main {
  margin-left: 180px; /* Same as the width of the sidebar */
  padding: 0px 10px;
}


.right-space {
  width:35px;
  display:flex;
  justify-content:center;
}

.noshow {
  display: none;
}

.input-border {
    border: 1px solid grey;
    outline: 0;

}

.table-1 {
  font-family:tahoma;
  font-size:1.025em; 

}

@media print{    

	.pg-line {
display:none !important;
}

.formbreak {
display:block;
page-break-after:auto;
}

	.btn, .btn-sm, #return-to-top,
#bottombuttons, #top-buttons1, a[href]:after{
display: none !important;
}
	.bs-details-tx, .container-tx {
page-break-inside:avoid;
display:block;
}

  table {
display:block;
page-break-after:auto;
}
  tr {
page-break-inside:avoid;
page-break-after:auto;
}

body {
padding:0 !important;
overflow:hidden !important;
color: #000;
background-color: #fff;
margin: 0 !important; 
font-size:12pt !important;
}

	#form_above-grid_1 {
display:none !important;
}
	#editPageButton1 {
display:none !important;
}
	.btn-link, .glyphicon, .glyphicon-search {
display:none !important;
}
	#return-to-top {
    display: none !important;
}
	#party_involved, #comm{
page-break-before:auto;
}
	hr {
display:none !important;
}

}
/*end media print*/


